import React from 'react';

function NoticeBoardPartition() {
  return (
    <div className="col m6 l6 hide-on-small-only">
      <div className="center ">
        {' '}
        <h5>
          Interested in selling? <br />
          Create a merchant accout with us!
        </h5>
      </div>
    </div>
  );
}

export default NoticeBoardPartition;
